const todoList = [
    {
      objectID: '1',
      title: 'Complete Assignment',
    },
    {
      objectID: '2',
      title: 'Take Dog on Walk',
    },
    {
      objectID: '3',
      title: 'Wash Dishes',
    }
  ];

  import React, { Component } from 'react';function TodoList() {
    <ul>
      {todoList.map(function (item) {
          return (
          <li key={item.objectID}> {item.title}</li>
          )
        })
      }
    </ul>
}

export default TodoList;
